Плюсы Чили: 

- цивилизация;
- безопасность. Это не типичный ЛАТАМ с ворами, бандосами с пушками наперевес, когда боишься выйти на улицу после наступления темноты (не работает для определённых районов некоторых городов);
- высокий уровень жизни;

- относительно понятный менталитет местных (это уже не ленивый ЛАТАМ с вечной маньяной, но ещё и не Северная Европа);
- климат, в любое время года можно быстро и недорого уехать в нужный климат;
- очень качественная и развитая инфраструктура.

Минусы страны:

- протестная активность;
- отсутствует социалка (мне наплевать, я привык за всё платить, но кому-то важно);
- страна развита неравномерно, это чувствуется в том числе и в менталитете;
- низкое качество именно культурного образования (умения перепроверять факты).
